import React from 'react'
import styled, { ThemeConsumer } from 'styled-components'
const Container=styled.div`
  background-color:${({theme})=>theme.bg};
  height:40px ;
`
export const Navbar = () => {
  return (
    <Container>Navbar</Container>
  )
}
